import Sidebar from './Sidebar';
import React, { useState, useEffect } from 'react';
import { Box, TextField, Typography, List, ListItem, ListItemText, Pagination } from '@mui/material';


const ListRegis = () => {

  return (
    <Box sx={{ display: 'flex', padding: 2 }}>
    {/* Sidebar */}
    <Sidebar />

    {/* Main content */}
    <Box sx={{ flex: 1, marginLeft: 2 }}>
      <Typography variant="h5" sx={{ backgroundColor: '#f39200', color: '#fff', padding: 1, borderRadius: 1, textAlign: 'center' }}>
        รายชื่อคนลงทะเบียน
      </Typography>
      
      <Box sx={{ marginY: 2 }}>
        <TextField
          fullWidth
          variant="outlined"
          placeholder="ค้นหา..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </Box>

      <List>
        {currentItems.length > 0 ? (
          currentItems.map((item) => (
            <ListItem key={item.id} sx={{ backgroundColor: '#fff', borderRadius: 1, marginBottom: 1, boxShadow: 1 }}>
              <ListItemText primary={item.name} />
            </ListItem>
          ))
        ) : (
          <Typography variant="body2" color="textSecondary" sx={{ textAlign: 'center', marginTop: 2 }}>
            ไม่พบข้อมูล
          </Typography>
        )}
      </List>

      <Box sx={{ display: 'flex', justifyContent: 'center', marginTop: 2 }}>
        <Pagination
          count={Math.ceil(totalItems / itemsPerPage)}
          page={currentPage}
          onChange={handlePageChange}
          variant="outlined"
          shape="rounded"
        />
      </Box>
    </Box>
  </Box>
);
};

export default ListRegis;
